export default function myApp() {
  return (
    <div>
      <h1> hello world, count the click</h1>
      <myButton />
      
    </div>
  );
}
function myButton(){
    const [ count, setCount] = useState(0)
    function handleClick(){
        setCount(count+ 1)
    }

return (
<button onClick={handleClick}>
    Clicked {count} times
</button>
)
}
